import React from 'react'

function NavBar() {
  return (
    <nav className="navBar">
      <a href='#'>View All Topics</a>
      <a href='#'>View View All Questions</a>
      <a href='#'>See the code</a>
      <a href='#'>Another button for something</a>
    </nav>
  )
}

export default NavBar
